import React, {useState} from 'react';
import "./Modal.css";

export default function Modal(obj) {
    console.log(obj);

    return (
        <div className="tile">
            <div className="top">
                <h3>{obj.title}</h3>
            </div>
            <div className="body">
                <p>{obj.desc}</p>
                <p>{obj.startend}</p>
            </div>
        </div>
    )
}
